/* eslint-disable jsx-a11y/anchor-is-valid */
import React from "react";
import { Link } from "react-router-dom";
import { shallowEqual, useSelector } from "react-redux";
import SVG from "react-inlinesvg";
import { useHistory } from "react-router-dom";
import { toAbsoluteUrl } from "../../../../_helpers";

export function QuickUser() {
  const history = useHistory();
  const user = useSelector((state) => state.auth.user, shallowEqual);

  const logoutClick = () => {
    const toggle = document.getElementById("kt_quick_user_toggle");
    if (toggle) {
      toggle.click();
    }
    history.push("/logout");
  };

  return (
    <div id="kt_quick_user" className="offcanvas offcanvas-left userProfilecanvas d-flex flex-column offcanvas">
      <div className="d-flex h-100 w-100">
        <div className="usermodalIconcontainer p-2 d-flex flex-column border-right">
          <span className="userIcon active">SK</span>
          <span className="userIcon">SK</span>
          <span className="userIcon">SK</span>
          <span className="userIcon">SK</span>
        </div>
        <div className="d-flex w-100 userModalcontent">
        <div className="d-flex col border-right">
          <div className="d-inline-block py-2">
            <div className="d-flex">
              <div className="modaluserIcon">
                <span className="userIcon">SK</span>
                <span className="userName">Sivakumar</span>
              </div>
            </div>
            <ul className="list-inline">
              <li><a href="">Settings</a></li>
              <li><a href="">Import/Export</a></li>
              <li><a href="">People</a></li>
              <li><a href="">People</a></li>
            </ul>
          </div>
        </div>        
        <div className="d-flex col">
          <div className="d-inline-block py-2">
            <div className="d-flex">
              <div className="modaluserIcon">
                <span className="userIcon">SK</span>
                <span className="userName">Sivakumar</span>
              </div>
            </div>
            <ul className="list-inline">
              <li><a href="">Settings</a></li>
              <li><a href="">Import/Export</a></li>
              <li><a href="">People</a></li>
              <li><a href="">People</a></li>
            </ul>
          </div>
        </div>        
      </div>
      </div>
      <div className="modaluserFootersection p-3 border-top bg-grey ">
        <span className="userIcon">SK</span>
          <span className="userIcon">SK</span>
          <span className="userIcon">SK</span>
      </div>
    </div>
  );
}
